import './Login.css'
class SignInForm extends Component {
    render() {
    return (
        <div className = "login">
            <div className = "Email_Input">
              <input 

                type = "Email"
                placeholder = "Enter The Valid Email"
            />
            </div>
            <div className = "Password_Input">
            <input 
                type = "password"
                placeholder = "Enter The password"
                name = "password"
            />
            </div>
        </div>
    )
    }


}
export default SignInForm;
